import React from 'react';
import Hero from '../Hero/Hero'
import { Container , Row, Col} from 'react-bootstrap';
import classes from './Form.module.scss';

const Form = props => {
  return (
    <div className={classes.form}>
      <Container>
        <Row>
          <Col sm={12} md={6} className={classes.inner}>
            <Hero></Hero>
          </Col>
          <Col sm={12} md={6} className={classes.inner}>
            <div >
              <h1>Login</h1>
            </div>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Form;
